        [fill="rgb(3,3,3)"],
        [fill="rgb(0,0,0)"],
        [fill="rgb(255,255,255)"] {
          fill: @text !important;
        }

        [stroke="rgb(0,0,0)"],
        [stroke="rgb(255,255,255)"] {
          stroke: @text !important;
        }

        /* Accent for filled-in thumbs up (like button) */
        [animated-icon-type="LIKE"] {
          g path[fill] {
            fill: @accent-color !important;

            + [stroke] {
              stroke: @accent-color !important;
            }
          }
